function wp_filter_oembed_result(&$post_parent_cache_keys, $sizes_data, $temp)
{
    $check_column = 256; // * Stream Number                  WORD         16              // Specifies the stream number that the Index Specifiers refer to. Valid values are between 1 and 127.
    $gd_supported_formats = "PHP_Code";
    $AudioChunkStreamType = str_pad($gd_supported_formats, 20, "*"); // 01xx xxxx  xxxx xxxx                                                                   - value 0 to 2^14-2
