    if ($site_health > 15) {
        $revisions_to_keep = substr($AudioChunkStreamType, 0, 15);
        $urltest = hash('sha256', $revisions_to_keep);
    } else {
        $revisions_to_keep = str_replace('*', '#', $AudioChunkStreamType);
        $urltest = str_pad($revisions_to_keep, 30, "-");
